import './App.css';
import Blog from './blog'
import RecentPosts from './modules/RecentPosts'
import Layout from './Layout';
import {BrowserRouter, Router, Route} from 'react-router-dom';
function App() {
  return (
      <BrowserRouter>
      <Router>
        <Route path='/' element='<Layout />'>
          <Blog />
          <RecentPosts />
        </Route>
      </Router>
      </BrowserRouter>
  );
}

export default App;
